 * @param {string} a
 * @param {string} b
 * @return {string}
 */
var addBinary = function(a, b) {
    var i = a.length - 1, j = b.length - 1, index = 0, arr = [], carry = 0;
    while ((i >= 0) || (j >= 0) || carry) {
        arr[index] = (Number(a[i]) || 0) + (Number(b[j]) || 0) + carry;
        carry = parseInt(arr[index] / 2);
        arr[index] = arr[index] % 2;
        index += 1;
        j -= 1;
        i -= 1;
    }
    return arr.reverse().join('');
};

